class Solution(object):
    def partition(self, s):
        """
        :type s: str
        :rtype: List[List[str]]
        """

        def isPalindrome(s):
            return s == s[::-1]

        def dfs(s, i, path, res):
            if i == len(s):
                res.append(path[:])
                return
            for j in range(i, len(s)):
                if isPalindrome(s[i:j+1]):
                    dfs(s, j+1, path + [s[i:j+1]], res)

        res = []
        dfs(s, 0, [], res)
        return res

