class Solution(object):
    def solveSudoku(self, board):
        """
        :type board: List[List[str]]
        :rtype: None Do not return anything, modify board in-place instead.
        """

        def solve(board):
            # Find an empty cell
            for i in range(9):
                for j in range(9):
                    if board[i][j] == '.':
                        for k in range(1, 10):
                            if isValid(board, i, j, str(k)):
                                board[i][j] = str(k)
                                if solve(board):
                                    return True
                                else:
                                    board[i][j] = '.'
                        return False
            return True

        def isValid(board, row, col, num):
            # Check row
            for i in range(9):
                if board[row][i] == num:
                    return False

            # Check column
            for i in range(9):
                if board[i][col] == num:
                    return False

            # Check box
            boxRow = row // 3
            boxCol = col // 3

            for i in range(3):
                for j in range(3):
                    if board[boxRow * 3 + i][boxCol * 3 + j] == num:
                        return False

            return True

        solve(board)

