        """
        :type nums: List[int]
        :rtype: List[List[int]]
        """

        def backtrack(nums, res, path):
            if len(nums) == 0:
                res.append(path)
            for i in range(len(nums)):
                backtrack(nums[:i] + nums[i+1:], res, path + [nums[i]])

